<h3><a href="dps">DPS</a> > O DPS</h3>
<h4></h4>
</div>
<div id="maincontent">

<font color="null"><b>Nasze motto "Zycie nabiera sensu, gdy umiemy cieszyc sie nim czyniac je piekniejszym dla drugiego czlowieka".</b></font><br><br><br><div align="left">Dom Pomocy Spolecznej przy ul. Krzywoustego 11 w Kutnie przeznaczony jest dla 71 osob obojga plci, w podeszlym wieku i przewlekle somatycznie chorych. </div><div align="left"><br></div><div align="left"><img src="data:image/jpeg;base64," height="222" width="296"> &nbsp; &nbsp; <img src="data:image/jpeg;base64," height="220" width="295"><br></div><div align="left"><br></div>Dom miesci sie w centrum Kutna na osiedlu Batorego, polozenie Domu stwarza mozliwosci korzystania z pobliskich sklepow, przychodni itp. Teren wokol Domu, jak i sam budynek pozbawiony jest barier architektonicznych, przystosowany do osob niepelnosprawnych. Na terenie Domu znajduje sie m.in.: kuchnia, jadalnia, pralnia, gabinet zabiegowy, sala terapii zajeciowej, sala cwiczen w zakresie rehabilitacji mieszkancow, biblioteka z czytelnia, kafejka internetowa. Mieszkancy maja rowniez do wlasnej dyspozycji pokoje dzienne, pokoje mieszkalne 2-, 3-, osobowe z pelnym zapleczem sanitarnym, podreczne kuchenki i kaplice.<br><br>Dla rodzin odwiedzajacych przygotowany jest pokoj goscinny. Dom calodobowo swiadczy uslugi opiekunczo-pielegnacyjne. Mieszkancy maja staly kontakt z lekarzem rodzinnym oraz dostep do lekarzy specjalistow, psychologa.<br><br>Prowadzimy dzialalnosc rekreacyjna, organizujemy wyjazdy, wycieczki, spotkania plenerowe, imprezy okolicznosciowe, turnusy rehabilitacyjne. Mieszkancy maja wypelniony czas wolny i moga rozwijac swoje zainteresowania i hobby w sali terapii zajeciowej. W naszym Domu funkcjonuja grupy terapeutyczne tj. plastyczna, porzadkowo-ogrodnicza, muzyczno-wokalna, czytelnicza, tkacka i choreograficzna, terapia ruchem. Prace uczestnikow terapii zajeciowej prezentowane sa na wystawach na terenie miasta i poza nim. Mieszkancy uczestnicza w imprezach kulturalnych, turystycznych i sportowych, ktore pozwalaja na przyjemne spedzanie czasu wolnego. Tradycja naszego Domu sa zabawy andrzejkowe, wspolne grilowanie, obchody Swiat Bozego Narodzenia, Swiat Wielkiej Nocy, Dni Babci i Dziadka, Dnia Kobiet i inne.<br><br><div align="left"><img src="data:image/jpeg;base64," height="258" width="345"><br></div><br>Szczegolna role w pracy Domu spelnia personel opiekunczo-terapeutyczny. Pielegniarki wykonuja drobne zabiegi, dozuja leki zlecone przez lekarza. Kazda osoba moze liczyc na pomoc opiekunow w podstawowych czynnosciach zyciowych.<br><br>Za wartosci nadrzedne w sferach zycia mieszkancow uznajemy m.in.: <br><ul><li>poszanowanie i ochrona godnosci czlowieka</li><li>indywidualny styl zycia</li><li>intymnosc i dyskrecje&nbsp;</li><li>moralnosc i rozwoj osobowosci...<br></li></ul>

